import { useSelector, shallowEqual } from "react-redux";
import classNames from "classnames";

import { PlayerLyricWrapper } from "./style";

export default memo(function LJPlayerLyric() {
  return (
    <PlayerLyricWrapper>
      <h2>LJPlayerLyric</h2>
    </PlayerLyricWrapper>
  );
});
